import React from "react"


class User extends React.Component {
  render() {
    return(<div>
        <h3>{el.firstname} {el.lastname}</h3>
        <p>{el.bio}</p>
        <b>{el.isHappy ? 'Scastliv :)' : 'Ne osobo :('}</b>
        </div>
    )
  }
}

export default User
